function App() {
  const onSubmit = (e) => e.preventDefault;
  return (
    <div>
      <form>
        <p>My ToDo List</p>
        <input type="text" placeholder="write your todo list"></input>
        <button>Add</button>
      </form>
    </div>
  );
}

export default App;
